<meta charset="UTF-8">

<script>

	function pulaLinha() {
		document.write("<br><br>");
	}

	function mostra(frase) {
		document.write(frase);
		pulaLinha();
	}

		var imprime = 30;

		while (imprime <=40){
			if (imprime !=33 && imprime !=37) {
				mostra (imprime)
			}

			imprime = imprime + 1
		}


</script>
